drop table countries;

CREATE TABLE countries (
   id serial NOT NULL PRIMARY KEY,
   name varchar NOT NULL,
   officialName varchar NOT NULL,
   capital varchar NOT NULL,
   iso2 varchar NOT NULL,
   iso3 varchar NOT NULL,
   currencyName varchar NOT NULL,
   totalConfirmed int NOT NULL,
   totalDeaths int NOT NULL,
   totalRecovered int NOT NULL,
   totalActive int NOT NULL,
   lastUpdate date NOT NULL
);

